--
-- Table structure for table `pre_certificate`
--

DROP TABLE IF EXISTS `pre_certificate`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pre_certificate` (
  `id` bigint(20) NOT NULL COMMENT 'id',
  `pack_doc_no` varchar(255) NOT NULL COMMENT '预制凭证编号',
  `original_id` bigint(20) NOT NULL COMMENT '原始数据流水号',
  `ecc_flag` tinyint(3) DEFAULT NULL COMMENT '是否推送ecc 0 否 1是',
  `ac_doc_no` varchar(255) DEFAULT NULL COMMENT '凭证编号',
  `ecc_result` tinyint(3) DEFAULT NULL COMMENT 'ecc结果 0 失败 1成功',
  `ecc_result_message` varchar(255) DEFAULT NULL COMMENT 'ecc结果原因',
  `buss_sys` varchar(255) NOT NULL COMMENT '业务系统',
  `buss_doc_type` varchar(255) NOT NULL COMMENT '业务单据类型',
  `buss_doc_no` varchar(255) NOT NULL COMMENT '业务单据号',
  `update_mod` varchar(255) NOT NULL COMMENT '处理方式 S-同步 A-异步',
  `doc_type` varchar(255) NOT NULL COMMENT '凭证类型 SA 总帐科目凭证 KR 供应商发票 AB 会计凭证 DA 客户凭证',
  `comp_code` varchar(255) NOT NULL COMMENT '公司代码',
  `fisc_year` varchar(255) NOT NULL COMMENT '会计年度',
  `doc_date` datetime NOT NULL COMMENT '凭证日期',
  `pstng_date` datetime NOT NULL COMMENT '过账日期',
  `header_txt` text COMMENT '凭证抬头文本',
  `ref_doc_no` varchar(255) NOT NULL COMMENT '参照',
  `currency` varchar(255) NOT NULL COMMENT '货币',
  `exch_rate` decimal(14,2) DEFAULT NULL COMMENT '汇率',
  `is_deleted` tinyint(3) DEFAULT '0' COMMENT '逻辑删除字段 0 正常 1 已删除',
  `company_id` bigint(20) DEFAULT NULL COMMENT '公司id',
  `version_no` int(11) DEFAULT '0' COMMENT '版本号:默认0,每次更新+1',
  `create_userid` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_username` varchar(100) DEFAULT NULL COMMENT '创建人用户名',
  `create_userip` varchar(255) DEFAULT NULL COMMENT '创建人IP',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-应用操作时间',
  `create_time_db` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-数据库操作时间',
  `server_ip` varchar(255) DEFAULT NULL COMMENT '服务器IP',
  `update_userid` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_username` varchar(100) DEFAULT NULL COMMENT '最后修改人用户名',
  `update_userip` varchar(255) DEFAULT NULL COMMENT '最后修改人IP',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='预制凭证表';
/*!40101 SET character_set_client = @saved_cs_client */;

