--
-- Table structure for table `pre_certificate_detail`
--

DROP TABLE IF EXISTS `pre_certificate_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pre_certificate_detail` (
  `id` bigint(20) NOT NULL COMMENT 'id',
  `pre_certificate_id` bigint(20) NOT NULL COMMENT '预制凭证表id',
  `pack_doc_item` int(11) NOT NULL COMMENT '预制凭证行号',
  `posting_key` varchar(64) NOT NULL COMMENT '记账代码 客户: 01 发票 客户: 11 贷方凭证  供应商: 21 贷项凭证  供应商: 31 发票  总帐: 40 借方分录  总帐: 50 贷方分录 ',
  `account_type` varchar(64) NOT NULL COMMENT '科目类型 A 资产 D客户 K供应商  M商品 S总分类帐科目',
  `gl_account` varchar(64) NOT NULL COMMENT '总账科目',
  `dr_cr_ind` varchar(64) NOT NULL COMMENT '借方/贷方标识 "H 贷方 S借方',
  `customer` varchar(64) DEFAULT NULL COMMENT '客户编号',
  `vendor_no` varchar(64) DEFAULT '' COMMENT '供应商编号',
  `sp_gl_ind` varchar(255) DEFAULT '' COMMENT '特殊总账标识 A 预付账款   B 其他应付款-代垫款  C 其他应付款-供应商保证金  D 其他应收款-供应商押金 ',
  `cost_ctr` varchar(20) DEFAULT '' COMMENT '成本中心',
  `profit_ctr` varchar(20) DEFAULT '' COMMENT '利润中心',
  `ref_key3` varchar(64) NOT NULL COMMENT '原始订单号',
  `order_id` varchar(64) DEFAULT '' COMMENT '业务单号',
  `buss_type` varchar(255) DEFAULT NULL COMMENT '业务类型',
  `cs_trans_t` varchar(255) DEFAULT NULL COMMENT '事务类型 A50 购买商品、接收劳务支付的现金 A52 支付的各项税费 A53 支付其他与经营活动有关的现金  A55 支付利息、手续费及佣金的现金 A56 支付给职工以及为职工支付的现金 ',
  `loc_curr_amt` decimal(14,2) NOT NULL COMMENT '本位币金额',
  `doc_curr_amt` decimal(14,2) NOT NULL COMMENT '凭证货币金额',
  `item_text` text COMMENT '项目文本',
  `tax_code` varchar(20) DEFAULT NULL COMMENT '税码',
  `supplier_code` varchar(20) DEFAULT NULL COMMENT '供应商编码',
  `customer_code` varchar(20) DEFAULT NULL COMMENT '客户编码',
  `pymt_meth` int(11) DEFAULT '0' COMMENT '收付方式',
  `is_deleted` tinyint(3) DEFAULT '0' COMMENT '逻辑删除字段 0 正常 1 已删除',
  `company_id` bigint(20) DEFAULT NULL COMMENT '公司id',
  `version_no` int(11) DEFAULT '0' COMMENT '版本号:默认0,每次更新+1',
  `create_userid` bigint(20) DEFAULT NULL COMMENT '创建人ID',
  `create_username` varchar(100) DEFAULT NULL COMMENT '创建人用户名',
  `create_userip` varchar(255) DEFAULT NULL COMMENT '创建人IP',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-应用操作时间',
  `create_time_db` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间-数据库操作时间',
  `server_ip` varchar(255) DEFAULT NULL COMMENT '服务器IP',
  `update_userid` bigint(20) DEFAULT NULL COMMENT '最后修改人ID',
  `update_username` varchar(100) DEFAULT NULL COMMENT '最后修改人用户名',
  `update_userip` varchar(255) DEFAULT NULL COMMENT '最后修改人IP',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='预制凭证详情表';
/*!40101 SET character_set_client = @saved_cs_client */;

