INSERT INTO `rule_block` VALUES (1,'header import',1,'引入JAVA需要使用的包,创建preCertificate对象','import java.time.LocalDate;\nimport java.time.format.DateTimeFormatter;\nimport com.s2b1233.certificate.model.vo.PreCertificateVO;\nimport com.s2b1233.certificate.model.vo.PreCertificateDetailVO;\npreCertificate = new PreCertificateVO();',0,21000,0,NULL,NULL,NULL,'2021-10-29 08:41:53','2021-10-29 08:41:53',NULL,NULL,NULL,NULL,'2021-11-05 08:14:28'),(2,'通用凭证header部分',100,'通用凭证HEADER部分生成','dateStr = LocalDate.now().format(DateTimeFormatter.ISO_DATE);\npreCertificate.id = id;\npreCertificate.originalId = original.id;\npreCertificate.bussSys = \"MY1233\";\npreCertificate.bussDocType = businessType.businessOrderTypeName;\npreCertificate.bussDocNo = original.businessCode;\npreCertificate.updateMod = \"A\";\npreCertificate.packDocNo = id + \"\";\npreCertificate.docType = businessType.certificateType;\npreCertificate.compCode = original.merchantCode;\npreCertificate.fiscYear = LocalDate.now().year + \"\";\npreCertificate.docDate = new Date();\npreCertificate.pstngDate = new Date();\npreCertificate.headerTxt = businessType.headerText+ dateStr;\npreCertificate.refDocNo = original.orderCode;\npreCertificate.currency = original.currency;\npreCertificate.exchRate = original.exchangeRate;\npreCertificate.eccFlag = 0;\npreCertificate.companyId = original.companyId;\npreCertificate.createUserid = original.createUserid;\nreturn preCertificate;',0,21000,0,NULL,NULL,NULL,'2021-10-29 08:44:31','2021-10-29 08:44:31',NULL,NULL,NULL,NULL,'2021-11-05 08:14:28'),(3,'通用凭证Item部分',100,'通用ITEM部分,统御科目获取供应商或客户编码','preCertificateDetail.id = id;\npreCertificateDetail.preCertificateId = preCerticateId;\npreCertificateDetail.packDocItem = subtypeItem.lineNumber;\npreCertificateDetail.postingKey = subtypeItem.postingKey;\npreCertificateDetail.accountType = subtypeItem.subjectType;\npreCertificateDetail.drCrInd = subtypeItem.debitCreditFlag;\nif (original.distributionType == 1) {\n    preCertificateDetail.customer = original.distributionCode;\n} else {\n    preCertificateDetail.vendorNo = original.distributionCode;\n}\npreCertificateDetail.spGlInd = \"\";\npreCertificateDetail.costCtr = original.costCenter;\npreCertificateDetail.profitCtr = original.profitCenter;\npreCertificateDetail.bussType = original.businessType;\npreCertificateDetail.csTransT = subtypeItem.csTransT;\npreCertificateDetail.refKey3 = original.orderCode;\npreCertificateDetail.itemText = businessType.digestText+format;\npreCertificateDetail.taxCode = originalItem.taxCode;\nreturn preCertificateDetail;',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-15 01:54:27'),(4,'收付方式为转账',4,'当收付方式必填时pymt_meth设置为0','preCertificateDetail.pymtMeth = 0;',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-05 05:38:46'),(5,'含税金额指令',2,'金额取含税金额','preCertificateDetail.locCurrAmt = originalItem.taxAmount;\npreCertificateDetail.docCurrAmt = originalItem.taxAmount;\nif (BigDecimal.ZERO.compare(preCertificateDetail.locCurrAmt)==0){\n    return null;\n}',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-15 01:54:27'),(6,'税额指令',2,'金额取税额','preCertificateDetail.locCurrAmt = originalItem.tax;\npreCertificateDetail.docCurrAmt = originalItem.tax;\nif (BigDecimal.ZERO.compare(preCertificateDetail.locCurrAmt)==0){\n    return null;\n}',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-15 01:54:27'),(7,'不含税金额指令',2,'金额取不含税金额','preCertificateDetail.locCurrAmt = originalItem.genericAmount;\npreCertificateDetail.docCurrAmt = originalItem.genericAmount;\nif (BigDecimal.ZERO.compare(preCertificateDetail.locCurrAmt)==0){\n    return null;\n}',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-15 01:54:27'),(8,'item import',1,'引入JAVA需要使用的包,创建detail对象','import java.time.LocalDate;\nimport java.time.format.DateTimeFormatter;\nimport com.s2b1233.certificate.model.vo.PreCertificateDetailVO;\nimport java.math.BigDecimal;\npreCertificateDetail = new PreCertificateDetailVO();',0,21000,0,NULL,NULL,NULL,'2021-10-29 09:08:16','2021-10-29 09:08:16',NULL,NULL,NULL,NULL,'2021-11-15 01:32:29'),(9,'科目字段处理',3,'先从科目表匹配,一级科目需要根据单据类型数据转为二级科目,统御科目填写供应商或客户编码','subject = subjectService.getSubjectByOriginItem(subtypeItem.subjectId, original.merchantCode, originalItem);\nif (subject.ruleSubject=0){\n    preCertificateDetail.glAccount = subject.id;\n}\n',0,NULL,0,NULL,NULL,NULL,'2021-11-15 01:51:37','2021-11-15 01:51:37',NULL,NULL,NULL,NULL,'2021-11-15 04:38:22');
